import Items from "../Items.jsx";
import Header from "../Header.jsx";
import SearchItems from "../SearchItems.jsx";
import NavBar from "../NavBar.jsx";
export default function HomePage({
  cartItems,
  items,
  handleAddToCart,
  isLogged,
  handleLogOut,
  userIdLogged,
  fetchAgain,
  handleDeleteItem,
  setNavigateItem,
  setSearchItems,
  searchItemsArray,
}) {
  return (
    <>
      <Header
        amountCart={cartItems.length}
        isLogged={isLogged}
        handleLogOut={() => handleLogOut(null, false)}
      />

      <SearchItems items={items} setSearchItems={setSearchItems} />

      <Items
        items={items}
        addToCart={handleAddToCart}
        isLogged={isLogged}
        userIdLogged={userIdLogged}
        fetchAgain={fetchAgain}
        handleDeleteItem={handleDeleteItem}
        setNavigateItem={setNavigateItem}
        searchItemsArray={searchItemsArray}
      />
      <div className="App">
        <NavBar searchItemsArray={searchItemsArray} />
        <main id="main" className="flexbox-col"></main>
      </div>
    </>
  );
}
